(1, 'Visita t√©cnica dos alunos do CEAS', '202004160111105e97dade4cdc5.jpg', 'Fonte: Assessoria de Comunica√ß√£o', '<p>Alunos do CEAS fazem visita t√©cnica na manh√£ desta quarta-feira na Getra<br></p>', '<p style=\"text-align: left;\">A Getra recebeu na manh√£ desta quarta-feira (29), a visita t√©cnica dos alunos do curso de Sa√∫de e Seguran√ßa do Trabalho do Ceas Escola T√©cnica. Uma manh√£ super proveitosa, onde os alunos puderam conhecer nossos profissionais, como tamb√©m as nossas instala√ß√µes e a rotina da nossa empresa, que preza pela compet√™ncia no trabalho que executa. Com toda certeza os alunos sa√≠ram dessa visita com um olhar diferenciado acerca da Sa√∫de e Seguran√ßa do Trabalho que foi a profiss√£o escolhida por eles. Nossos colaboradores se sentem lisonjeados em poder colaborar com esses alunos.</p>', 1, '2020-04-16 04:11:10', '2020-08-24 14:07:34', NULL),
(2, 'Lombalgia lidera motivo de afastamento do trabalho', '202004160112405e97db385b91b.jpg', 'Fonte: https://www.contabeis.com.br/', '<p>Inc√¥modo nas costas √© o principal motivo que afasta trabalhadores dos seus postos<br></p>', '<p style=\"text-align: left;\">Levantamento do Instituto Nacional do Seguro Social (INSS) aponta crescimento de 6% no volume de afastamento de trabalhadores por doen√ßas ou complica√ß√µes de sa√∫de. Com mais de 83 mil casos, lombalgia (dor na regi√£o lombar) √© a principal causa.</p><p style=\"text-align: left;\">A falta de um programa de acompanhamento postural e uso correto dos equipamentos fornecidos pelas empresas est√£o entre os principais motivos que levam milhares de trabalhadores aos consult√≥rios m√©dicos com dores na regi√£o da lombar.</p><p style=\"text-align: left;\">Dados da Organiza√ß√£o Mundial de Sa√∫de (OMS) apontam que que lombalgia √© a segunda maior causa de visita aos consult√≥rios m√©dicos, perde apenas para dor de cabe√ßa.</p><p style=\"text-align: left;\">\"Na maioria das vezes, especialmente em pacientes jovens e de meia idade, a lombalgia, famosa dor nas costas, √© um sintoma de uma contratura muscular ou distens√£o muscular, que normalmente est√£o ligadas a coisas muito pr√≥ximas do nosso dia a dia, como postura inadequada ao desempenhar atividades corriqueiras, como pegar peso de mal jeito sem uma postura adequada da coluna‚Äù, afirma&nbsp; Angelo Guar√ßoni, m√©dico neurocirurgi√£o e de coluna.</p><p style=\"text-align: left;\">Seja por realizar um trabalho repetitivo, excesso de tempo em uma determinada posi√ß√£o ou mesmo for√ßar um exerc√≠cio na academia, n√£o √© incomum encontrar algu√©m sofrendo de dores na lombar. Na grande maioria das vezes, esse inc√¥modo √© localizado, por√©m, em pequenos casos, pode ser sintoma de uma doen√ßa mais grave, principalmente em idosos.</p><p style=\"text-align: left;\">Uma visita ao consult√≥rio logo no in√≠cio pode ser suficiente para diagn√≥stico e tratamento adequado, evitando o agravamento do caso. ‚ÄúS√≥ o especialista consegue definir o que √© essa dor. Se √© uma lombalgia vinda de uma contratura muscular, m√° postura, ou se √© referente a algum outro problema de sa√∫de como pedra nos rins, infec√ß√µes urin√°rias ou h√©rnia de disco‚Äù, destaca o m√©dico.</p><p style=\"text-align: left;\">Al√©m da lombalgia, fraturas nos p√©s, nas m√£os, transtornos de discos invertebrais, leiomioma do √∫tero lideram nos motivos que afastam trabalhadores de suas fun√ß√µes.</p>', 1, '2020-04-16 04:12:40', '2020-08-14 14:26:43', NULL),
(3, 'O que √© Engenharia de Seguran√ßa do Trabalho?', '202004160113535e97db81b5e04.png', 'Fonte: https://www.educamaisbrasil.com.br/', '<p>Saiba mais sobre o curso e o mercado de trabalho dessa profiss√£o<br></p>', '<p style=\"text-align: left;\">O Engenheiro de Seguran√ßa do Trabalho √© o profissional respons√°vel por coordenar e efetuar an√°lise de projetos a serem implantados, em conjunto com as √°reas t√©cnicas, recomendando altera√ß√µes, visando reduzir ou eliminar os riscos de acidentes e doen√ßas ocupacionais. Al√©m disso, orienta a Comiss√£o Interna de Preven√ß√£o de Acidentes (CIPA) das empresas e fornece instru√ß√µes aos funcion√°rios sobre o uso de equipamentos de prote√ß√£o individual (EPIs).¬†</p><p style=\"text-align: left;\">O que estudar para ser Engenheiro de Seguran√ßa do Trabalho?</p><p style=\"text-align: left;\">Segundo a Lei 7410/85 para exercer a profiss√£o na √°rea, √© necess√°rio fazer um curso de gradua√ß√£o em Arquitetura ou Engenharia ‚Äì nas modalidades civil, eletricista, mec√¢nica e metal√∫rgica, qu√≠mica, geologia e minas e agrimensura, com dura√ß√£o m√©dia de 4 a 5 anos, e depois fazer uma p√≥s-gradua√ß√£o em Engenharia de Seguran√ßa do Trabalho.¬†</p><p style=\"text-align: left;\">Durante o curso, o aluno ir√° se deparar com mat√©rias espec√≠ficas sobre a integra√ß√£o do homem ao ambiente de trabalho, normas e legisla√ß√£o, preven√ß√£o de riscos, √©tica e cidadania, rela√ß√£o com o Conselho Regional de Engenharia e Agronomia (CREA), dentre outras.</p>', 1, '2020-04-16 04:13:53', '2021-07-06 13:20:35', NULL),
(4, 'Dia dos Engenheiros e TST', '202007131637095f0cb7e541a63.png', 'http://www.protecao.com.br/', 'Dia dos Engenheiros e TSTs √© comemorado no dia 27', '<div style=\"text-align: left;\">27 de novembro, √© uma data marcante entre os prevencionistas: √© o Dia do T√©cnico e do Engenheiro de Seguran√ßa do Trabalho. A data celebra o dia em que ambas as profiss√µes foram regularizadas pelo Minist√©rio do Trabalho por meio da Lei n¬∫ 7.410, de 27 de novembro de 1985. Tanto os engenheiros quanto os t√©cnicos de Seguran√ßa do Trabalho v√™m atuando junto a outros profissionais da √°rea em busca de melhores condi√ß√µes nos ambientes laborais. Embora a lei tenha sa√≠do somente na d√©cada de 1980, ambos j√° desempenhavam suas fun√ß√µes muito antes desta data, iniciando timidamente a partir da cria√ß√£o das CIPAs em 1944, ganhando maior impulso com a regulamenta√ß√£o dos SESMTs em 1972 e finalmente com a publica√ß√£o das NRs em 1978.</div>', 1, '2020-07-13 19:37:09', '2020-08-14 14:26:29', NULL),
(5, 'Dia do M√©dico do Trabalho', '202007131647475f0cba6317255.png', 'http://revistacipa.com.br/', 'Dia do M√©dico do Trabalho', '<div style=\"text-align: left;\">Os m√©dicos do trabalho em todo o mundo celebram, nesta sexta-feira, uma data especial para a especialidade. Trata-se do Dia do M√©dico do Trabalho, comemorado no dia 4 de outubro em homenagem ao nascimento do m√©dico italiano Bernardino Ramazzini (1633-1714).Para a ANAMT, a escolha da data √© a consolida√ß√£o do exerc√≠cio da profiss√£o. A celebra√ß√£o vem de encontro ao anseio de por em evid√™ncia a atua√ß√£o do m√©dico da √°rea e sua responsabilidade na manuten√ß√£o de condi√ß√µes ideais de trabalho. Mais do que celebrar a Medicina do Trabalho, o 4 de outubro √© dia de honrar o legado de Ramazzini, reafirmando nosso compromisso com esta especialidade m√©dica que lida com as rela√ß√µes entre homens e mulheres trabalhadores e seus respectivos of√≠cios, visando n√£o somente a preven√ß√£o dos acidentes e das doen√ßas do trabalho, mas a promo√ß√£o da sa√∫de e da qualidade de vida. H√° mais de 300 anos, Ramazzini, considerado o precursor da especialidade, come√ßou a pavimentar rumos que seguimos at√© hoje: o estabelecido de liga√ß√µes entre determinadas ocupa√ß√µes e as enfermidades sofridas pelas profissionais que as praticavam.</div>', 1, '2020-07-13 19:47:47', '2020-08-14 14:26:13', NULL),
(6, 'Titulo', '202008241121175f43ccdda2eb6.jpg', 'Getra', '<p>Teste</p>', '<p>Teste</p>', 1, '2020-08-24 14:21:17', '2020-08-24 14:22:00', '2020-08-24 11:08:00'),
(7, 'Como prevenir acidentes no trabalho em altura?', '202008241141175f43d18dd82bd.jpg', 'Getra', '<p><span style=\"color: rgb(119, 119, 119); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">A melhor maneira de evitar acidentes √© seguindo as disposi√ß√µes da NR 35.</span><br></p>', '<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 7.2pt;\" id=\"docs-internal-guid-124c5b80-7fff-0fd1-cb31-ad05f7f04cb7\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Como prevenir acidentes no trabalho em altura?</span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Quando o trabalhador exerce suas atividades em locais que est√£o acima de 2 metros do n√≠vel inferior, seja o solo ou n√£o, √© considerado trabalho em altura. O que regula essa √°rea √© a Norma Regulamentadora n.¬∫ 35 (NR 35). O trabalho realizado sob essas condi√ß√µes tem alguns riscos, como por exemplo quedas de escadas ou andaimes, s√£o comuns, infelizmente. </span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Toda atividade requer cuidados e equipamentos espec√≠ficos, priorizando a seguran√ßa e o bem estar dos colaboradores. A melhor maneira de evitar acidentes √© seguindo as disposi√ß√µes da NR 35. O que dar√° seguran√ßa para os funcion√°rios mas tamb√©m para organiza√ß√£o que garante estar cumprindo todas as diretrizes. √â essencial que haja capacita√ß√£o e treinamento de todos os empregados que trabalhar√£o nas atividades em altura. A carga hor√°ria deve ser de 8 horas</span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">A NR 35 lista responsabilidades tanto do patr√£o quanto dos empregados para garantir a prote√ß√£o de todos que frequentam o local de trabalho. Estas s√£o algumas das obriga√ß√µes.</span></p>', 1, '2020-08-24 14:41:17', '2020-08-24 14:41:47', '2020-08-24 11:08:47'),
(8, 'Como prevenir acidentes no trabalho em altura?', '202008241153165f43d45c635f8.jpg', 'Getra', '<div style=\"text-align: justify;\"><span style=\"font-size: 12px; color: rgb(119, 119, 119); font-family: Arial;\">Toda atividade requer cuidados e equipamentos espec√≠ficos, priorizando a seguran√ßa e o bem estar dos colaboradores. A melhor maneira de evitar acidentes √© seguindo as disposi√ß√µes da NR 35. O que dar√° seguran√ßa para os funcion√°rios mas tamb√©m para organiza√ß√£o que garante estar cumprindo todas as diretrizes. √â essencial que haja capacita√ß√£o e treinamento de todos os empregados que trabalhar√£o nas atividades em altura. A carga hor√°ria deve ser de 8 horas</span></div>', '<div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b>Como prevenir acidentes no trabalho em altura?‚Ä®‚Ä®‚Ä®Quando o trabalhador exerce suas atividades em locais que est√£o acima de 2 metros do n√≠vel inferior, seja o solo ou n√£o, √© considerado trabalho em altura. O que regula essa √°rea √© a Norma Regulamentadora n.¬∫ 35 (NR 35). O trabalho realizado sob essas condi√ß√µes tem alguns riscos, como por exemplo quedas de escadas ou andaimes, s√£o comuns, infelizmente. ‚Ä®‚Ä®Toda atividade requer cuidados e equipamentos espec√≠ficos, priorizando a seguran√ßa e o bem estar dos colaboradores. A melhor maneira de evitar acidentes √© seguindo as disposi√ß√µes da NR 35. O que dar√° seguran√ßa para os funcion√°rios mas tamb√©m para organiza√ß√£o que garante estar cumprindo todas as diretrizes. √â essencial que haja capacita√ß√£o e treinamento de todos os empregados que trabalhar√£o nas atividades em altura. A carga hor√°ria deve ser de 8 horas‚Ä®‚Ä®A NR 35 lista responsabilidades tanto do patr√£o quanto dos empregados para garantir a prote√ß√£o de todos que frequentam o local de trabalho. Estas s√£o algumas das obriga√ß√µes do empregador:</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>garantir que sejam implementadas as medidas de prote√ß√£o da NR;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>desenvolver um procedimento de opera√ß√µes para as atividades em altura;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>acompanhar o cumprimento das medidas de prote√ß√£o da NR e das empresas de seguran√ßa do trabalho;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>garantir que os empregados tenham informa√ß√µes atualizadas sobre os riscos da atividade e de todas as medidas de seguran√ßa;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>assegurar que o trabalho em altura seja sempre feito sob supervis√£o, de acordo com a an√°lise de riscos e a atividade bem como um plano de resgate de v√≠timas de eventual acidente.</b></span></font></div><div style=\"text-align: left;\">¬† ¬† ¬† ¬†¬†</div><div style=\"text-align: left;\"><b style=\"font-size: 12px; color: rgb(119, 119, 119); font-family: Arial;\">J√° para os empregados, essas s√£o algumas responsabilidades:</b></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>cumprir todas as disposi√ß√µes da lei e das normas a respeito do trabalho em altura, inclusive as obrigatoriedades que o empregador imp√µe;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>colaborar sempre com o empregador garantindo que as medidas de seguran√ßa estejam sendo implementadas;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>interromper suas atividades sempre que for constatada uma evid√™ncia de riscos graves para a sua seguran√ßa e sa√∫de bem como demais envolvidos;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>‚Ä¢<span style=\"white-space:pre\">	</span>zelar pela pr√≥pria seguran√ßa e tamb√©m das outras pessoas que frequentam os locais em que h√° trabalho em altura.</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b>Para que todas as medidas sejam eficazes tamb√©m √© necess√°rio o uso de EPI‚ÄôS, alguns mais gen√©ricos outros espec√≠ficos, como cinto de seguran√ßa do tipo paraquedista; trava quedas; talabartes (ajust√°veis, simples e duplos tipo Y);linhas de vida vertical e horizontal; ancoragens; capacete com jugular; botina; luva de seguran√ßa.</b></span></font></div>', 1, '2020-08-24 14:53:16', '2020-08-24 17:18:37', NULL),
(9, 'Sinais de um AVC', '202012091645305fd1295ad3a76.jpg', 'Getra', '<p>-</p>', '<p><span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 13.5pt; line-height: 19.26px; font-family: Arial, sans-serif; color: rgb(68, 68, 68);\"><o:p>&nbsp;</o:p></span><span style=\"font-family: Arial, sans-serif; font-size: 10.5pt;\"><span style=\"font-family: Arial;\">O AVC decorre da altera√ß√£o do fluxo de sangue ao c√©rebro. Respons√°vel pela morte de c√©lulas nervosas da regi√£o cerebral atingida, o AVC pode se originar de uma obstru√ß√£o de vasos sangu√≠neos, o chamado acidente vascular isqu√™mico, ou de uma ruptura do vaso, conhecido por acidente vascular hemorr√°gico. Cerca de 70% das pessoas que sofrem um derrame n√£o retorna ao trabalho depois do acidente vascular cerebral e 50% ficam dependentes de outras pessoas.</span><br><br><span style=\"font-family: Arial;\">Alguns sintomas podem ser percebidos e tendo conhecimento deles fica mais f√°cil procurar ajuda o quanto antes, s√£o eles:</span><br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\"><br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Dificuldade para falar;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Perda de vis√£o;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Perda da sensibilidade de um lado do corpo;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Altera√ß√µes motoras;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Paralisia de um lado do corpo;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Dist√∫rbio de linguagem;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Dist√∫rbio sensitivo<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Altera√ß√£o no n√≠vel de consci√™ncia.<br><br>Estar atento a esses sintomas pode salvar a sua vida. √â poss√≠vel evitar um AVC mantendo um estilo de vida saud√°vel, tendo uma alimenta√ß√£o baseada em nutrientes e mantendo atividades f√≠sicas regulares, isso possibilita a diminui√ß√£o de casos.</span><br></p>', 1, '2020-12-09 19:45:30', '2020-12-09 19:45:30', NULL),
(10, 'Medicina do trabalho: exames ocupacionais', '2021061513544960c8db59e6c35.jpg', 'Quais exames s√£o obrigat√≥rios?', '<p>GETRA</p>', '<p>Os exames ocupacionais s√£o obrigat√≥rios e est√£o previstos na legisla√ß√£o trabalhista, regulamentada pela Portaria n¬∫ 3214. As empresas tem a obriga√ß√£o de garantir acesso de seus funcion√°rios a medicina do trabalho, podendo haver san√ß√µes caso haja o descumprimento da norma e o atraso nos prazos previstos em lei.</p><p>O ASO Atestado de Sa√∫de Ocupacional, ser√° expedido para comprovar se o funcion√°rio est√° apto ou n√£o a exercer suas fun√ß√µes. Geralmente esse tipo de trabalho √© terceirizado, ou seja, as organiza√ß√µes contratam empresas especializadas em Sa√∫de e Seguran√ßa do Trabalho para realizar estes exames. √â de suma import√¢ncia que a empresa seja especializada para que possa orientar o setor de Recursos Humanos nas d√∫vidas que surgem no dia a dia.</p><p>O ASO √© o exame realizado nos seguintes cen√°rios: Admissional, Demissional, Peri√≥dico, Mudan√ßa de fun√ß√£o e Retorno ao trabalho. Al√©m disso, dependendo da fun√ß√£o exercida e dos riscos ocupacionais envolvidos no posto de trabalho, outros exames complementares devem ser realizados, conforma as normas regulamentadoras NR 7 e NR 9. Mas esses 5 mencionados anteriormente s√£o obrigat√≥rios de serem realizados, respeitando os prazos previstos em lei.</p><p>Admissional - Esse exame tem como fun√ß√£o atestar se o colaborador que est√° sendo contratado est√° apto no momento da contrata√ß√£o, para determinada fun√ß√£o.</p><p>Demissional - O exame deve ser realizado quando o colaborador √© desligado da empresa.</p><p>Peri√≥dico - A periodicidade desse exame varia de acordo com a idade e as condi√ß√µes de trabalho as quais o colaborador √© exposto.</p><p>Mudan√ßa de fun√ß√£o - Esse exame deve ser feito sempre que a mudan√ßa de local ou fun√ß√£o de trabalho exponha o funcion√°rio a riscos diferentes do cargo anteriormente ocupado.</p><p>Retorno ao trabalho - Sempre que o funcion√°rio se afastar da empresa por mais de 30 dias por motivo de doen√ßa ou licen√ßa-maternidade, esse exame deve ser realizado.</p><p>A medicina do trabalho √© importante tanto na vida do colaborador como na vida da empresa. Seguir as normas vai al√©m de cumprir meramente regras, com todas essas a√ß√µes aliadas a outras pr√°ticas √© poss√≠vel preservar vidas, al√©m de manter a reputa√ß√£o da empresa. Empresa e colaborador s√≥ tem a ganhar com as medidas certas sendo implementadas.</p>', 1, '2021-06-15 16:54:50', '2021-06-15 16:54:50', NULL),
(11, 'O que √© o Exame Admissional?', '2021070610254660e459da4c0f1.jpg', 'Saiba mais', '<p>Getra</p>', '<p>O Exame Admissional √© previsto na CLT, onde os empregadores s√£o obrigados a realizar esse exame nos novos colaboradores. Exames de aptid√£o f√≠sica e mental que possibilitem atestar se aquele colaborador est√° apto a exercer as fun√ß√µes as quais ele est√° sendo contratado. Essa avalia√ß√£o tamb√©m deve ser feita com periodicidade enquanto o colaborador fizer parte do grupo de funcion√°rios e no poss√≠vel desligamento tamb√©m. Todos esses exames est√£o previstos no ASO - Atestado de Sa√∫de Ocupacional.</p><p>Com esse exame tanto a empresa quanto o colaborador ficam respaldados, ou seja isso garante a seguran√ßa de ambos para a execu√ß√£o das fun√ß√µes.</p><p>Pois bem o Admissional deve ser feito em at√© 15 dias da contrata√ß√£o do funcion√°rio. Nesse processo s√£o avaliados a press√£o arterial, batimentos card√≠acos, o hist√≥rico de doen√ßas familiares, em alguns casos dependendo da fun√ß√£o exames como o de vis√£o e audi√ß√£o tamb√©m podem ser solicitados.</p><p>Todo o exame que conste no Atestado de Sa√∫de Ocupacional deve ser realizado por uma empresa especializada em Sa√∫de e Seguran√ßa do Trabalho. Com toda seguran√ßa e profissionalismo, para garantir a seguran√ßa da empresa e do colaborador.¬†</p>', 1, '2021-07-06 13:25:46', '2021-07-20 13:12:54', NULL),
(12, 'Voc√™ sabe o que √© EPC?', '2021072010150260f6cc5650025.jpg', 'Saiba mais', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">EPC ‚Äì\r\nEquipamento de Prote√ß√£o Coletiva s√£o equipamentos fornecidos pela empresa para\r\na seguran√ßa dos colaboradores, protegendo dos riscos oferecidos pelo tipo de\r\ntrabalho executado. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Os EPC‚Äôs tem\r\ncomo objetivo prevenir os trabalhadores ou terceiros que transitem no ambiente;\r\nminimizar perdas e assim aumentar a produtividades, justamente porque a partir\r\ndo momento que os trabalhadores est√£o em local seguro sua produtividade\r\naumenta.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Al√©m do que\r\nest√° disposto na NR 01, existem tamb√©m as normas NR 04 e 09 que tamb√©m disp√µem\r\ndas obrigatoriedades relativas ao uso de EPC‚Äôs.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Deve ser\r\nfeita uma avalia√ß√£o de riscos para assim determinar quais s√£o os equipamentos\r\nque devem ser usados. Abaixo citaremos alguns exemplos:<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Cones<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Fitas<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Placas de\r\nsinaliza√ß√£o<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Alarmes<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Plataformas<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-fam