(13, 'NR 33 - Espa√ßos Confinados', '20210728143249610194c1e5604.jpg', 'Voc√™ sabe o que √©?', '<p>Getra</p>', '<p>A Norma Regulamentadora 33, trata de espa√ßos confinados. Desde 2006 foi criada a portaria que prev√™ a NR 33. Essa norma atua diretamente no estabelecimento de espa√ßos confinados, ou seja, avalia, monitora e controla os riscos existentes.</p><p>Segundo essa norma, o espa√ßo confinado √© qualquer ambiente ou √°rea n√£o projetado para ocupa√ß√£o humana cont√≠nua, apresentando meios limitados de entrada e sa√≠da. As principais atividades que apresentam esse trabalho, √© a constru√ß√£o civil e ind√∫stria.</p><p>A NR 33 determina que al√©m dos trabalhadores t√©cnicos que s√£o devidamente autorizados para a fun√ß√£o, √© necess√°rio contar com: respons√°vel t√©cnico, supervisor de entrada e vigia. Tudo isso para garantir a seguran√ßa dos envolvidos. Por se tratar de uma √°rea que apresenta periculosidade, os trabalhadores precisam passar por uma capacita√ß√£o que fica a cargo do empregador oferecer.&nbsp;</p><p><span style=\"color: rgb(38, 38, 38); font-family: Nunito;\">Medidas de seguran√ßa como sinaliza√ß√£o e isolamento da √°rea, PET, equipamentos medidores de oxig√™nio, medidores de gases t√≥xicos e equipamentos de ventila√ß√£o, s√£o necess√°rios.</span><br></p><p>Cada vez mais fica em evidencia a necessidade de investir em sa√∫de e seguran√ßa do trabalho, garantindo seguran√ßa para o empregador e seus colaboradores. Por isso as NRs s√£o estabelecidas e precisam ser cumpridas, conforme determinam o seu texto.</p><p><br></p>', 1, '2021-07-28 17:32:49', '2021-07-28 17:32:49', NULL),
(14, 'Exame de retorno ao trabalho', '202108110940196113c533b4fb1.jpg', 'Saiba mais', '<p>Getra</p>', '<p>O exame de retorno ao trabalho faz parte da serie de exames ocupacionais que precisam ser realizados pelos colaboradores. Esse exame deve ser realizado no primeiro dia de retorno do trabalhador, ap√≥s ele ter permanecido afastado por per√≠odo igual ou superior a 30 dias, sendo o motivo acidente ou doen√ßa, sejam ocupacionais ou n√£o.&nbsp;</p><p>A norma que regulamenta os exames ocupacionais √© a NR 7 e estabelece a obrigatoriedade do PCMSO - Programa de Controle M√©dico de Sa√∫de Ocupacional, sendo obrigat√≥rio para todas as empresas que possuem funcion√°rios.</p><p>Ap√≥s o exame, o m√©dico deve emitir um Atestado de Sa√∫de Ocupacional ASO, que tamb√©m √© obrigat√≥rio.</p><p>Aqui na Getra n√≥s fazemos os exames ocupacionais da sua empresa. Entre em contato conosco para saber mais.</p>', 1, '2021-08-11 12:40:19', '2021-08-11 12:41:52', NULL),
(15, 'NR 12', '2021092010314861488d4490da8.jpg', 'Getra', '<p>Norma que regulamenta a seguran√ßa no trabalho em m√°quinas e equipamentos<br></p>', '<p style=\"margin-top:0cm;line-height:21.0pt\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">A NR 12 √© a Norma Regulamentadora\r\nde Seguran√ßa do Trabalho em M√°quinas e Equipamentos. Tem como principal\r\nobjetivo de regulamentar e definir padr√µes de seguran√ßa e qualidade nas rotinas\r\nprodutivas que fazem uso de equipamentos, ou seja, garantir a seguran√ßa, sa√∫de\r\ne integridade f√≠sica dos trabalhadores.</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p><p style=\"margin-top: 0cm; line-height: 21pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">A\r\nNR 12 foi um passo importante para regulamentar os par√¢metros de seguran√ßa de\r\nseguran√ßa para garantir o bem-estar e a integridade f√≠sica dos trabalhadores.\r\nEssa norma exige informa√ß√µes completas sobre todo o ciclo de vida de m√°quinas e\r\nequipamentos, incluindo transportes, instala√ß√£o, utiliza√ß√£o, manuten√ß√£o e at√©\r\nmesmo sua elimina√ß√£o ao final da vida √∫til.</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p><p style=\"margin-top: 0cm; line-height: 21pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Ela\r\ndetermina que cabe ao empregador adotar medidas de prote√ß√£o capazes de garantir\r\na sa√∫de e a integridade f√≠sica dos trabalhadores. Enquanto isso, cabe ao\r\nfuncion√°rio:</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p><p style=\"margin-top: 0cm; line-height: 21pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">-\r\nCumprir as orienta√ß√µes para uma opera√ß√£o segura.<br>\r\n- N√£o fazer altera√ß√µes nas prote√ß√µes mec√¢nicas ou dispositivos de seguran√ßa de\r\nm√°quinas e equipamentos.<br>\r\n- Comunicar imediatamente a chefia se algum maquin√°rio for danificado de forma\r\nque possa comprometer a seguran√ßa dos envolvidos no trabalho.<br>\r\n- Participar de capacita√ß√µes e treinamentos para atender √†s normas de seguran√ßa.<br>\r\n- E ainda colaborar com o empregador para fazer valer as disposi√ß√µes da NR 12.</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p style=\"margin-top: 0cm; line-height: 21pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">A\r\ncapacita√ß√£o dos colaboradores √© de extrema import√¢ncia para garantir a\r\nseguran√ßa de todos. Conte com uma empresa especializada em Sa√∫de e Seguran√ßa do\r\ntrabalho para ajudar a sua empresa. Conte com a Getra.</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p>', 1, '2021-09-20 13:31:48', '2021-09-20 13:31:48', NULL),
(16, 'Gr√°vidas e lactantes n√£o podem exercer atividades insalubres', '202109281434336153522931e94.jpg', 'Saiba mais', '<p>Getra</p>', '<p><span style=\"font-family: Arial;\">Gestantes e lactantes n√£o podem exercer atividades insalubres, a CLT traz no Art 394-A que \"a empregada gestante ser√° afastada, enquanto durar a gesta√ß√£o, de quaisquer atividades, opera√ß√µes ou locais insalubres e exercer√° suas atividades em local salubre, exclu√≠do, nesse caso, o pagamento de adicional de insalubridade. N√£o havendo necessidade de apresentar atestado m√©dico.</span></p><p><span style=\"background-color: rgb(249, 249, 249); font-family: Arial; font-size: 16px;\">¬ß</span><span style=\"background-color: rgb(249, 249, 249); font-family: &quot;Varela Round&quot;; font-size: 16px;\">&nbsp;</span><span style=\"font-family: Arial;\">3¬∫ Quando n√£o for poss√≠vel que a gestante ou a lactante afastada nos termos do caput deste artigo exer√ßa suas atividades em local salubre na empresa, a hip√≥tese ser√° considerada como gravidez de risco e ensejar√° a percep√ß√£o de sal√°rio-maternidade, nos termos da Lei n¬∫ 8.213 de 24 de Julho de 1991, durante todo o per√≠odo de afastamento. (Inclu√≠do pela Lei n¬∫ 13.467 de 2017)</span></p><p><span style=\"font-family: Arial;\">Fique atento as normas, caso tenha colaboradoras gr√°vidas ou lactantes na sua empresa, siga todas as normas de seguran√ßa descritas em lei.</span></p><p><span style=\"font-family: Arial;\">Uma empresa sem acidentes s√≥ depende de voc√™!</span></p><p><span style=\"font-family: Arial;\">Ôªø</span><br></p>', 1, '2021-09-28 17:34:33', '2021-09-28 17:34:33', NULL),
(17, 'Insalubridade x Periculosidade', '2022031614193362321c2550904.jpg', 'Entenda', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:\" arial\",sans-serif\"=\"\"><span style=\"font-family: Arial;\">Algumas\r\natividades quando realizadas exp√µem o trabalhador a riscos,</span><span style=\"letter-spacing: 0.15pt; font-family: Arial;\">&nbsp;a legisla√ß√£o brasileira pela Consolida√ß√£o\r\ndas Leis do Trabalho&nbsp;</span></span><a href=\"https://www.contabeis.com.br/trabalhista/clt/\" style=\"outline: none; line-height: inherit; padding: inherit; float: inherit;\"><b><span style=\"color: windowtext; letter-spacing: 0.15pt; font-family: Arial;\">(CLT)</span></b></a><span style=\"letter-spacing: 0.15pt; font-family: Arial;\">&nbsp;garante um tipo prote√ß√£o ao colaborador com\r\nos adicionais de pagamento chamados de insalubridade ou periculosidade.</span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial; letter-spacing: 0.15pt;\">Ambas devem ser pagas de\r\nforma adicional pelo empregador na&nbsp;</span><span style=\"font-family:\r\n\" arial\",sans-serif\"=\"\"><a href=\"https://www.contabeis.com.br/trabalhista/folha_de_pagamento/\" style=\"outline: none; line-height: inherit; padding: inherit; float: inherit;\"><b><span style=\"color: windowtext; letter-spacing: 0.15pt; font-family: Arial;\">folha de pagamento,</span></b></a><span style=\"letter-spacing: 0.15pt; font-family: Arial;\">&nbsp;mas t√™m regras, c√°lculos e caracter√≠sticas diferentes. Pois bem, vamos explicar um pouco mais sobre esses termos.</span></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial; color: rgb(64, 64, 64); letter-spacing: 0.15pt;\">Aquilo que √© considerado insalubre quer dizer que pode\r\ntrazer malef√≠cios √† sa√∫de da pessoa, portanto colocaria a sa√∫de do trabalhador\r\nem risco.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"color: rgb(64, 64, 64); font-family: Arial, sans-serif; letter-spacing: 0.15pt;\">A periculosidade tamb√©m