(18, 'Atestado de Sa√∫de Ocupacional', '20220405104427624c47bb9eae6.png', 'Entenda', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:\" arial\",sans-serif\"=\"\">O ASO ‚Äì\r\nAtestado de Sa√∫de Ocupacional <span style=\"color: rgb(44, 47, 52); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">√©\r\numa declara√ß√£o m√©dica que indica se o trabalhador est√° em condi√ß√µes (apto) ou\r\nn√£o (inapto) de realizar determinadas atividades ou fun√ß√µes dentro de uma\r\nempresa.</span><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(44, 47, 52); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Esse atestado avalia se a sa√∫de do colaborador est√° de acordo\r\ncom a exposi√ß√£o de risco que as atividades que ele vai exercer trazem. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">O ASO √© obrigat√≥rio para todos os empregadores e empresas que\r\ncontratam sob o regime da Consolida√ß√£o das Leis do Trabalho (CLT). O atestado\r\nde sa√∫de ocupacional deve ser emitido no m√≠nimo em duas vias: uma para o\r\ncontratante e outra para o empregado.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Caso