(19, 'Acidentes de Trabalho', '20220509151009627959010a7a8.jpg', 'Precisam ser evitados', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Acidentes de\r\ntrabalho infelizmente s√£o muito comuns e acontecem todos os dias, com les√µes\r\nque podem ser desde as tempor√°rias at√© as permanentes, em alguns casos at√©\r\nfatais. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Em todas as\r\nesferas os acidentes causam preju√≠zos, al√©m de ser um dever manter a sa√∫de e\r\nseguran√ßa dos seus colaboradores dentro da empresa, afastamentos por acidentes\r\nde trabalho v√£o gerar muitos preju√≠zos para empresa enquanto organiza√ß√£o.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Al√©m do\r\npagamento de multas, o colaborador deixa de exercer suas fun√ß√µes, o que faz com\r\nque a empresa tenha custos que podem e devem ser evitados.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Acidentes de\r\ntrabalho podem ser evitados todos os dias, mantendo um ambiente de trabalho\r\nseguro, com uso de EPI‚Äôs e conscientiza√ß√£o de todos que fazem a empresa, muitos\r\nriscos podem ser minimizados.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Contar com uma\r\nempresa especializada em Sa√∫de e Seguran√ßa do Trabalho para ajudar nesse\r\ntrabalho √© de extrema import√¢ncia. N√£o espere acidentes acontecerem para se prevenir.\r\n<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Entre em\r\ncontato com a Getra por algum de nossos canais e saiba mais:<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">@getragestao / </span><span style=\"font-size: 10.5pt; line-height: 107%; font-family: &quot;Segoe UI Symbol&quot;, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">üìû</span><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">(83) 3201-1446 / 9 9988-1495</span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><o:p></o:p></span></p>', 1, '2022-05-09 18:10:09', '2022-05-09 18:10:09', NULL),
(20, 'Exame de Espirometria', '202205170825036283860fcfcfa.jpg', 'Entenda', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">O exame de <span style=\"color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Espirometria √© um exame utilizado para\r\nmedir a quantidade e o fluxo de ar que entra e sai dos pulm√µes do paciente.</span>\r\nAltera√ß√µes podem indicar doen√ßas respirat√≥rias como asma ou DPOC.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">A</span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><a href=\"https://portaltelemedicina.com.br/blog/laudo-de-espirometria-via-telemedicina\" target=\"_blank\"><strong style=\"border: transparent; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit;\"><span style=\"color: blue; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;espirometria\r\nocupacional</span></strong></a><span style=\"color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;trata de monitorar a sa√∫de respirat√≥ria de\r\ntrabalhadores em atividades insalubres para o aparelho respirat√≥rio, como em\r\nambientes onde s√£o expostos a poeira ou produtos qu√≠micos, j√° que est√£o\r\nsujeitos a desenvolver doen√ßas restritivas ou obstrutivas como a fibrose\r\npulmonar.<o:p></o:p></span></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Caso alguma altera√ß√£o seja identificada no padr√£o\r\nrespirat√≥rio, deve ser iniciada a investiga√ß√£o para identificar as causas.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Esse exame dentro dos processos de Sa√∫de e Seguran√ßa do\r\nTrabalho s√£o de extrema import√¢ncia para manter a sa√∫de do colaborador em dia.\r\nAl√©m de manter o monitoramento da empresa acerca dos seus colaboradores,\r\nevitando problemas futuros.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Sa√∫de e Seguran√ßa do Trabalho √© coisa s√©ria, conte com uma\r\nempresa s√©ria e comprometida com voc√™ e a sua empresa.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Uma empresa sem acidentes s√≥ depende de voc√™.</span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><o: