(21, 'Eletroencefalograma - EEG', '20220523142547628bc39b063fc.jpg', 'Entenda', '<p>Getra&nbsp;</p>', '<p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">O eletroencefalograma, ou\r\nEEG, √© um exame feito para avaliar a atividade el√©trica do c√©rebro, sendo\r\nindicado para identificar altera√ß√µes neurol√≥gicas.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Normalmente esse exame √©\r\nindicado pelo cl√≠nico geral ou Neurologista em algumas situa√ß√µes: <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:12.0pt;line-height:\r\n200%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#404040;mso-fareast-language:PT-BR\">- Diagnosticar epilepsia;<br>\r\n- Acompanhamento da resposta ao tratamento da epilepsia;<br>\r\n- Suspeita de altera√ß√µes da fun√ß√£o cerebral, como a encefalopatia;<br>\r\n- Detec√ß√£o de inflama√ß√µes ou intoxica√ß√µes cerebrais, como a encefalite;<br>\r\n- Investiga√ß√£o de desmaios ou perda de consci√™ncia em pessoas que possuem\r\nexames card√≠acos normais;&nbsp;<br>\r\n- Identifica√ß√£o de altera√ß√µes cerebrais ap√≥s AVC, hemorragia intracraniana ou\r\nsubaracn√≥ide;<br>\r\n- Monitorar a profundidade da anestesia em procedimentos cir√∫rgicos;<br>\r\n- Monitorar a atividade do c√©rebro durante uma cirurgia cerebral;<br>\r\n- Induzir o coma terap√™utico;<br>\r\n- Detectar altera√ß√µes da atividade cerebral;<br>\r\n- Detec√ß√£o de altera√ß√µes da atividade cerebral, no caso de tumor no c√©rebro;<br>\r\n- Avalia√ß√£o de dist√∫rbios do sono;<br>\r\n- Complemento da avalia√ß√£o de doen√ßas cerebrais ou doen√ßas psiqui√°tricas.<o:p></o:p></span></p><p class=\"MsoNormal\">\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; line-height: 200%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Quando\r\nrelacionado a Sa√∫de e Seguran√ßa do Trabalho </span><span style=\"font-size: 12pt; line-height: 200%; font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">esse\r\nexame √© feito para detectar diversas doen√ßas neurol√≥gicas e psiqui√°tricas.\r\nRealizado nos colaboradores de mesma categoria do ECG.</span> <span style=\"font-size: 12pt; line-height: 200%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Qualquer pessoa pode realizar um\r\neletroencefalograma, n√£o havendo contraindica√ß√µes absolutas</span>.&nbsp;<span style=\"font-size:12.0pt;line-height:200%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#404040;mso-fareast-language:\r\nPT-BR\"><o:p></o:p></span></p>', 1, '2022-05-23 17:25:47', '2022-05-23 17:25:47', NULL),
(22, 'O ambiente profissional deve ser saud√°vel', '2022053015362962950ead3ac00.jpg', 'Entenda', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Um ambiente de\r\ntrabalho saud√°vel estimula os colaboradores a oferecerem o seu melhor, o que\r\nfaz com que a produtividade seja maior. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Oferecer um\r\nambiente estimulante faz toda a diferen√ßa no resultado final e aqui vamos citar\r\nalguns dos benef√≠cios: <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">- Motiva o\r\ncolaborador<br>\r\n- Diminui a taxa de turnover<br>\r\n- Maior qualidade de vida do profissional<br>\r\n- Estimula o di√°logo<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Cabe as\r\nempresas investirem em pr√°ticas que proporcionem o bem-estar dos seus\r\ncolaboradores no dia a dia. Um ambiente seguro que transmite o cuidado garante\r\nque os trabalhadores sejam ainda mais produtivos.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Essas pr√°ticas s√£o\r\nben√©ficas para a empresa, que conta com uma equipe motivada e produtiva. Ambos\r\nos lados saem ganhando.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Conte com uma\r\nConsultoria em Sa√∫de e Seguran√ßa do Trabalho para ajudar nesse processo.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Conte com a\r\nGetra!!<o:p></o:p></span></p>', 1, '2022-05-30 18:36:29', '2022-05-30 18:36:29', NULL),
(23, 'Principais multas e-Social e SST.', '2023030114042563ff8599c874f.jpg', 'GETRA - Gest√£o em Seguran√ßa do Trabalho', '<p>Destacamos algumas das principais causas de multas do eSocial e seus respectivos valores, considerando alguns eventos, principalmente SST</p>', '<p>Destacamos algumas das principais causas de multas do eSocial e seus respectivos valores, considerando alguns eventos, principalmente SST, s√£o eles:<br style=\"\">üìåN√£o informar admiss√µes ‚Äì o valor da multa vai de R$800 a R$ 3.000,00 por empregado e pode dobrar de valor em caso de reincid√™ncia;<br style=\"\">üìåN√£o comunicar altera√ß√µes contratuais e cadastrais ‚Äì multas podem ser de R$ 201,27 at√© R$402,54 por funcion√°rio;<br style=\"\">üìåSST: N√£o comunicar acidentes de trabalho (n√£o envio do CAT) ‚Äì multa varia entre o limite m√≠nimo e m√°ximo do sal√°rio do funcion√°rio. Se houver reincid√™ncia o valor √© dobrado;<br style=\"\">üìåSST: N√£o informar riscos do trabalho ‚Äì multas entre R$ 1.812,87 a R$ 181.284,63;<br style=\"\">üìåSST: N√£o monitorar a sa√∫de do trabalhador (n√£o elaborar o PCMSO) ‚Äì multas que varia de R$ 1.436,53 a R$ 4.024,42;<br style=\"\">üìåSST: N√£o informar afastamentos tempor√°rios ‚Äì multa fica entre R$1.812,87 a R$181.284,63;<br style=\"\">üìåSST: N√£o comunicar o ASO ‚Äì a multa varia entre R$402,53 e R$4.025,33.<br style=\"\">Para evitar as multas do eSocial SST, a sua empresa precisa contar com uma assessoria de gest√£o SST como a GETRA. Entre em contato conosco!<br></p>', 1, '2023-03-01 17:04:25', '2023-03-01 17:04:25', NULL),
(24, 'Checklist do SST e-Social', '2023030114093663ff86d092e60.png', 'GETRA - Gest√£o em Seguran√ßa do Trabalho', '<p><br></p><p>√â importante ficar atento aos seguintes documentos de SST obrigat√≥rios para o envio das informa√ß√µes pelo eSocial.<br></p>', '<p>√â importante ficar atento aos seguintes documentos de <b>SST </b>obrigat√≥rios para o envio das informa√ß√µes pelo <b>eSocial</b>:<br style=\"\">üìå<b>PCMSO </b>‚Äì Programa de Controle M√©dico de Sa√∫de Ocupacional;<br style=\"\">üìå<b>AET </b>‚Äì An√°lise Ergon√¥mica do Trabalho;<br style=\"\">üìå<b>LTCAT </b>‚Äì Laudo T√©cnico das Condi√ß√µes Ambientais do Trabalho;<br style=\"\">üìå<b>PPRA </b>‚Äì Programa de Preven√ß√£o de Riscos Ambientais;<br style=\"\">üìå<b>Laudo de Periculosidade</b>;<br style=\"\">üìå<b>Laudo de Insalubridade</b>;<br style=\"\">Precisando de ajuda para garantir que a sua institui√ß√£o esteja de acordo com a regulamenta√ß√£o vigente? Entre em contato com a GETRA-üìû(83)-3321-1446<br></p>', 1, '2023-03-01 17:09:36', '2023-03-01 17:09:36', NULL),
(25, 'N√£o s√£o todas MEI, ME e EPP que pode emitir a DIR.', '2023030114175663ff88c4683da.png', 'GETRA - Gest√£o em Seguran√ßa do Trabalho', '<p>A <b>DIR </b>√© permitida apenas para empresas <b>MEI</b>, <b>ME </b>e <b>EPP </b>grau de risco 1 e 2 *que n√£o identificar riscos f√≠sicos, qu√≠micos, biol√≥gicos para dispensa do <b>PGR </b>e ergon√¥micos para dispensa do <b>PCMSO</b>.<br style=\"\"><b>*MEI</b> est√° dispensado de <b>PGR </b>- usa FICHA <b>MEI</b>.<br style=\"\">Para dispensa do <b>PCMSO </b>a regra √© a mesma das <b>ME </b>e <b>EPP</b><br></p>', '<p>A <b>DIR </b>√© permitida apenas para empresas <b>MEI</b>, <b>ME </b>e <b>EPP</b> grau de risco 1 e 2 *que n√£o identificar riscos f√≠sicos, qu√≠micos, biol√≥gicos para dispensa do <b>PGR </b>e ergon√¥micos para dispensa do <b>PCMSO</b>.<br style=\"\"><b>*MEI </b>est√° dispensado de <b>PGR </b>- usa <b>FICHA MEI</b>.<br style=\"\">Para dispensa do <b>PCMSO </b>a regra √© a mesma das <b>ME </b>e <b>EPP</b><br style=\"\"><br style=\"\">A quem se destina?<br style=\"\"><br style=\"\">O p√∫blico-alvo da <u>Ferramenta de Avalia√ß√£o de Risco </u>do <b>PGR </b>que tiver emitido sua <b>DIR </b>fica dispensado de elaborar o<b> (PGR)</b>, previsto no item 1.5.3.1.1 da NR-1.<br style=\"\">O <u>Microempreendedor Individual</u> <b>(MEI)</b> j√° est√° automaticamente dispensado de elaborar o <u>Programa de Gerenciamento de Risco</u><b> (PGR)</b> em raz√£o do item 1.8.1 NR-01.<br style=\"\">As demais empresas *<b>MEI</b>, <b>ME </b>ou <b>EPP</b>, grau de risco 1, 2, 3 e 4, obrigadas a constituir <b>SESMT </b>ficam obrigadas a implementar <b>GRO/PGR</b> normalmente.<br style=\"\"><br style=\"\">Fale conosco: (83) 3201-1446/ (83) 99988-1495<br></p>', 1, '2023-03-01 17:17:56', '2023-03-01 17:17:56', NULL);
